import React from "react";
import { Link } from "react-router-dom";
import { IoHome } from "react-icons/io5";
import './Home.css';

const Home = () => {
    return (
        <header className="navbar">
            <Link className="navbar-link" to="/Home" title="Home"><IoHome /></Link>
            <div className="dropdown">
                <label className="navbar-link">Student</label>
                <div className="dropdown-content">
                    <Link to="/StudentLogin">Login</Link>
                    <Link to="/StudentSignup">Signup</Link>
                </div>
            </div>
            <div className="dropdown">
                <label className="navbar-link">Landlord</label>
                <div className="dropdown-content">
                    <Link to="/LandlordLogin">Login</Link>
                    <Link to="/LandlordSignup">Signup</Link>
                </div>
            </div>
            <Link className="navbar-link" to="/WardenLogin" title="WardenLogin">Warden</Link>
            <Link className="navbar-link" to="/AdminLogin" title="AdminLogin">Admin</Link>
        </header>
    );
}

export default Home;
